public class InnerEndpointConfigProductionVariantFactory(Action<Humidifier.SageMaker.EndpointConfigTypes.ProductionVariant> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.EndpointConfigTypes.ProductionVariant>
{

    internal InnerEndpointConfigManagedInstanceScalingFactory ManagedInstanceScalingFactory { get; set; }

    internal InnerEndpointConfigRoutingConfigFactory RoutingConfigFactory { get; set; }

    internal InnerEndpointConfigServerlessConfigFactory ServerlessConfigFactory { get; set; }

    protected override Humidifier.SageMaker.EndpointConfigTypes.ProductionVariant Create()
    {
        var productionVariantResult = CreateProductionVariant();
        factoryAction?.Invoke(productionVariantResult);

        return productionVariantResult;
    }

    private Humidifier.SageMaker.EndpointConfigTypes.ProductionVariant CreateProductionVariant()
    {
        var productionVariantResult = new Humidifier.SageMaker.EndpointConfigTypes.ProductionVariant();

        return productionVariantResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.EndpointConfigTypes.ProductionVariant result)
    {
        base.CreateChildren(result);

        result.ManagedInstanceScaling ??= ManagedInstanceScalingFactory?.Build();
        result.RoutingConfig ??= RoutingConfigFactory?.Build();
        result.ServerlessConfig ??= ServerlessConfigFactory?.Build();
    }

} // End Of Class

